import React from "react";
import Navbar from "./Navbar";
import MyButton from "./MyButton";
import Footer from "./Footer";

export default function App() {
  return (
    <div className="min-h-screen flex flex-col">
      {/* Navbar */}
      <Navbar />

      {/* Main content */}
      <main className="flex-grow">
        {/* Home Section */}
        <section id="home" className="mx-auto max-w-6xl px-6 py-16 text-center">
          <h1 className="text-5xl font-extrabold mb-6">Welcome to My Portfolio</h1>
          <p className="text-lg mb-6">
            Iâ€™m a passionate developer building modern web applications with React and TypeScript.
          </p>
          <MyButton text="Learn More" />
        </section>

        {/* About Section */}
        <section id="about" className="mx-auto max-w-6xl px-6 py-16">
          <h2 className="text-3xl font-bold mb-4">About</h2>
          <p className="mb-4">
            This website was built step by step using React and TypeScript. It demonstrates modular components, reusable buttons, and structured layouts.
          </p>
          <p>
            React allows developers to create interactive UIs, while TypeScript provides type-safety and better tooling support.
          </p>
        </section>

        {/* Add more sections here like Services, Projects, etc. */}
      </main>

      {/* Footer */}
      <Footer />
    </div>
  );
}
